import React from 'react';
import ListWrapper from './ListWrapper/ListWrapper';

const ItemList = () => [
    {
        image: "https://source.unsplash.com/random",
        name: "George Well",
        Link: "https://source.unsplash.com/random",
    }
]
class App extends React.Component {

    render() {
        return (
            <ListWrapper />
        )
    }
}

export default App;
